import "./css/loginform.css"
function Login() {
    return (
        <>
        <form className = "form" id = "login-form">
            <h3>Đăng Nhập</h3>
            <div>
                <input name = "username" placeholder = "Tài khoản" type = "text"></input>
                <input autocomplete="off" name = "password" placeholder = "Mật Khẩu" type = "password"></input>
                <input value = "send" type = "submit"></input>
            </div>
        </form>
        </>
    )
}
function Register() {
    return (
        <form className = "form" id = "register-form">
            <h3>Đăng Kí</h3>
            <div>
                <input name = "username" placeholder = "Tài khoản" type = "text"></input>
                <input name = "password" placeholder = "Mật khẩu" type = "password"></input>
                <input name = "verifiedpassword" placeholder = "verifiedpassword" type = "verifiedpassword"></input>
                <input value = "send" type = "submit"></input>
            </div>
        </form>
    )
}
function LoginForm() {
    return (
        <div id = "form-container">
        <Login/>
        <Register />
        </ div>
    )
}
export { LoginForm }
